import React from "react";
import {Row,Col} from "reactstrap";
class Savecards extends React.Component{
    render(){
        return(
            <Col lg="4" md="4" sm="6" xs="12"style={{border:"1px solid"}}>
                <div className="card-box"> 
                    <div className="cover">
                        <div className="icons">
                            
                        </div>
                    </div>
                    <Row>
                        <Col lg="3" md="3" sm="3" xs="3" style={{marginLeft:"6px",paddingTop:"4px"}}>
                            <div style={{borderRadius:"200%",textAlign:"center",border:"1px solid",height:"45px",width:"75%",display:"inline-block",paddingLeft:"1px",backgroundColor:"black"}}>
                                <i className="fa fa-file" aria-hidden="true" style={{fontSize:"28px",height:"100%",display:"block",marginTop:"5px",color:"white"}}></i>
                            </div> 
                        </Col>
                        <Col lg="8" md="8" sm="8" xs="8">
                            <strong>Name</strong>
                        </Col>
                    </Row>
                </div>
            </Col>
        );
    }
}

export default Savecards;
